package leetcode

import "testing"

func Test_validPalindrome(t *testing.T) {
	type args struct {
		s string
	}
	tests := []struct {
		name string
		args args
		want bool
	}{
		{
			"[Test Case 1]",
			args{
				"aba",
			},
			true,
		},
		{
			"[Test Case 2]",
			args{
				"abca",
			},
			true,
		},
		{
			"[Test Case 3]",
			args{
				"",
			},
			true,
		},
		{
			"[Test Case 4]",
			args{
				"ebcbbececabbacecbbcbe",
			},
			true,
		},
		{
			"[Test Case 5]",
			args{
				"pidbliassaqozokmtgahluruufwbjdtayuhbxwoicviygilgzduudzgligyviciowxbhuyatdjbwfuurulhagtmkozoqassailbdip",
			},
			false,
		},
	}
	for _, tt := range tests {
		t.Run(tt.name, func(t *testing.T) {
			if got := validPalindrome(tt.args.s); got != tt.want {
				t.Errorf("validPalindrome() = %v, want %v", got, tt.want)
			}
		})
	}
}
